from sympy import isprime
def ok(n, prevset):
    if not isprime(n): return False
    b = bin(n)[2:]
    bi = (b[:i]+b[i+1:] for i in range(len(b)))
    return any(t[0] != '0' and int(t, 2) in prevset for t in bi)
def afind(terms):
    s, snxt = {2, 3}, set()
    print("0,", len(s), end=", ")
    for n in range(3, terms+1):
        for i in range(2**(n-1), 2**n):
            if ok(i, s):
                snxt.add(i)
        s, snxt = snxt, set()
        print(len(s), end=", ")
